import React, { useEffect, useState } from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Avatar from '@mui/material/Avatar';
import Grid from '@mui/material/Grid';
import Alert from '@mui/material/Alert';

export default function TeamPilotsPage() {
  const [drivers, setDrivers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchDrivers = async () => {
      setLoading(true);
      try {
        const player_id = localStorage.getItem('player_id');
        const selectedLeague = localStorage.getItem('selectedLeague') || localStorage.getItem('league');
        
        if (!player_id) {
          setError('Debes iniciar sesión');
          setLoading(false);
          return;
        }

        if (!selectedLeague) {
          setError('Debes seleccionar una liga');
          setLoading(false);
          return;
        }

        let leagueData;
        try {
          leagueData = JSON.parse(selectedLeague);
        } catch (e) {
          setError('Error al leer la liga seleccionada');
          setLoading(false);
          return;
        }

        const res = await fetch(`/api/players/${player_id}/drivers?league_id=${leagueData.id}`);
        const data = await res.json();
        
        if (!res.ok) {
          throw new Error(data.error || 'Error cargando pilotos');
        }
        
        setDrivers(data.drivers || []);
      } catch (err) {
        setError('Error cargando pilotos: ' + err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchDrivers();
  }, []);

  if (loading) return <Typography sx={{ p: 2 }}>Cargando pilotos...</Typography>;
  if (error) return <Alert severity="error" sx={{ m: 2 }}>{error}</Alert>;

  return (
    <Box sx={{ p: 2 }}>
      <Typography variant="h5" gutterBottom>Mis Pilotos</Typography>
      {drivers.length === 0 ? (
        <Alert severity="info" sx={{ mt: 2 }}>
          No tienes pilotos en esta liga. Ve al mercado para adquirir pilotos.
        </Alert>
      ) : (
        <Grid container spacing={2}>
          {drivers.map((driver) => (
            <Grid item xs={12} sm={6} md={4} key={driver.id}>
              <Card sx={{ height: '100%', background: '#181c24', color: '#fff' }}>
                <CardContent>
                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                    <Avatar 
                      src={driver.image_url ? `/images/${driver.image_url}` : ''} 
                      alt={driver.driver_name}
                      sx={{ width: 60, height: 60, mr: 2, border: '2px solid #fff' }}
                    />
                    <Box>
                      <Typography variant="h6" sx={{ fontWeight: 700 }}>
                        {driver.driver_name}
                      </Typography>
                      <Typography variant="body2" color="#b0b0b0">
                        {driver.team}
                      </Typography>
                    </Box>
                  </Box>
                  <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 1 }}>
                    <Typography variant="body2" color="#b0b0b0">Valor:</Typography>
                    <Typography variant="body2" sx={{ fontWeight: 700, color: '#4caf50' }}>
                      {driver.valor.toLocaleString()} €
                    </Typography>
                  </Box>
                  <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 1 }}>
                    <Typography variant="body2" color="#b0b0b0">Puntos totales:</Typography>
                    <Typography variant="body2" sx={{ fontWeight: 700, color: '#ff9800' }}>
                      {driver.total_points}
                    </Typography>
                  </Box>
                  <Box sx={{ display: 'flex', justifyContent: 'space-between' }}>
                    <Typography variant="body2" color="#b0b0b0">Puntos semana:</Typography>
                    <Typography variant="body2" sx={{ fontWeight: 700, color: '#2196f3' }}>
                      {driver.week_points}
                    </Typography>
                  </Box>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      )}
    </Box>
  );
}
